import React from 'react';

const NextPage = () => {
  return (
    <div className="flex flex-col justify-center items-center h-screen">
      {/* Heading and Subheading */}
      <div className="text-center mb-8">
        <h1 className="text-3xl font-bold">What is your math comfort level?</h1>
        <p className="text-lg text-gray-600">Subheading</p>
      </div>

      {/* Square Boxes */}
      <div className="flex flex-wrap justify-center gap-4">
        {[...Array(4)].map((_, index) => (
          <div key={index} className="w-40 bg-white border rounded-lg p-4">
            <img src="/placeholder.jpg" alt="Placeholder" className="w-16 h-16 mx-auto mb-2" />
            <h2 className="text-lg font-bold mb-1">What is your math comfort level?</h2>
            <p className="text-sm text-gray-600">choose the highest level you feel confident in - you can always adjust later.</p>
          </div>
        ))}
      </div>

      {/* Continue Button */}
      <button className="py-3 px-6 bg-gray-800 text-white rounded mt-8">Continue</button>
    </div>
  );
};

export default NextPage;
